    letters : string[][]
    letterMultiplier : number[][]
    wordMultiplier : number[][]
}

export const Board: FunctionComponent<BoardProps> = ({letters,letterMultiplier, wordMultiplier}) =>
    <div className="tileGrid">
        {Array.from(Array(225).keys()).map((key) =>
            <div key = {key} id = {""+key} className="tileContainer">
            </div>)}
    </div>
